    firstName,
    lastName,
    fileName,
    ) {
        const status = [];
        await signUpUser(firstName, lastName)
        .then(async (data) => {
            status.push({ status: 'fulfilled', value: data });
            await uploadPhoto(fileName);
        }).catch((err) => {
            status.push({ status:'rejected', value: err.tostring() });
        });
}

